import { Component } from '@angular/core';
import { Employee } from '../employee';
import { Observable } from 'rxjs';
import { EmployeeService } from '../employee.service';
import { Router } from '@angular/router';

import { FormGroup, FormControl, Validators } from '@angular/forms';


@Component({
  selector: 'app-add-employee',
  templateUrl: './add-employee.component.html',
  styleUrls: ['./add-employee.component.css']
})
export class AddEmployeeComponent //implements OnInit//
  {



    private baseURL = "http://localhost:8080/api/v1/employees";
  employee : Employee = new Employee();

  constructor(
    private employeeService: EmployeeService,
    private router: Router) {

    }




  saveEmployee(){
    this.employeeService.addEmployee(this.employee).subscribe( data =>{
      console.log(data);
      this.goToEmployeeList();
    },
    error => console.log(error));
  }

  goToEmployeeList(){
    this.router.navigate(['/show-all-employees']);
  }

  ngOnInit(): void {}
    onSubmit(){  
      console.log(this.employee);
      // console.log(this.addEmpoyee.get("fname"))
      this.saveEmployee();
    }


}

<br><br>
<br><br>
<div class="col-md-6 offset-md-3">
    <form (ngSubmit)="onSubmit()" class="row g-3 form-container ">

        <div class="form-group col-md-6">
            <label><b>First Name</b></label>
            <input type="text" class="form-control" id="fname" [(ngModel)]="employee.fname" name="fname" required />
        </div>

        <div class="form-group col-md-6">
            <label><b>Last Name</b></label>
            <input type="text" class="form-control" id="lname" [(ngModel)]="employee.lname" name="lname" required>
        </div>

        <br><br>

        <div class="form-group">
            <label><b>Email Id</b></label>
            <input required type="email" class="form-control" id="email" [(ngModel)]="employee.email" name="email" required>
        </div>

        <br><br>

        <div class="form-group col-md-6">
            <label class="form-label"><b>Department</b></label>
            <select id="department" class="form-select" [(ngModel)]="employee.department" name="department" required>
                <option value="" selected>Choose...</option>
                <option>IT</option>
                <option>HR</option>
                <option>Finance</option>
                <option>Marketing</option>
            </select>
        </div>

        <div class="form-group col-md-6">
            <label class="form-label"><b>Designation</b></label>
            <select id="designation" class="form-select" [(ngModel)]="employee.designation" name="designation" required>
                <option value="" selected>Choose...</option>
                <option>Developer</option>
                <option>Manager</option>
                <option>Analyst</option>
                <option>Accountant</option>
            </select>
        </div>

        <br><br>

        <div class="form-group col-md-6">
            <label><b>Salary</b></label>
            <input type="text" class="form-control" id="salary" [(ngModel)]="employee.salary" name="salary" required>
        </div>

        <div class="form-group col-md-6">
            <label><b>Joining Date</b></label>
            <input required type="text" class="form-control" id="joiningDate" [(ngModel)]="employee.joiningDate" name="joiningDate" required>
        </div>

        <br><br><br><br>

        <button class="btn btn-success" type="submit">Submit</button>

    </form>
</div>
